Content.Code:
T=T0-6.5e-3*h;
P=P0*Math.pow(T0/T,-5.256);
ro = P/Rp/T;
Fl = ro*V*g;
rodg = P/Rp/Tdg;
w = rodg*V*g+ws+wl;
m = w/g;
derv =(Fl-w)/m;
derh = v;
derTdg = apagado*K*(T-Tdg)+(1.0-apagado)*q;

public void QuemadorON () {
 Quemador=true;
 apagado = 0.0;
}

public void QuemadorOFF () {
 Quemador=false;
 apagado = 1.0;
}

public void CambiaT0 () {
 h=0;v=0;Tdg=T0;
 if (T0deg<T0mindeg) T0deg=T0mindeg;
 if (T0deg>T0maxdeg) T0deg=T0maxdeg;
 T0 = T0deg+273.15;
}

public void CambiaP0 () {
 h=0;v=0;Tdg=T0;
 _resetView();
 if (P0hPa<P0hmin) P0hPa=P0hmin;
 if (P0hPa>P0hmax) P0hPa=P0hmax;
 P0 = P0hPa*100;
}

public void Cambiawl () {
 if (ml<0) ml=0;
 if (ml>mlmax) ml=mlmax;
 wl = ml*g;
}

public double Flcalc (double P0, double T0, double h) {
return P0*Math.pow(T0/(T0-6.5e-3*h),-5.256)*V*g/Rp/(T0-6.5e-3*h);
}

public double wcalc (double P0, double T0, double h, double Tdg, double wl) {
return P0*Math.pow(T0/(T0-6.5e-3*h),-5.256)*V*g/Rp/Tdg+ws+wl;
}
